window.bookSummaryJSON = "<b>A washed-out painter battling to forget her past.<br>A profiler who needs all the help he can get.<br>To get to know the artist, they'll have to face a killer's deadly work...or become the main attraction.</b><br><br>Hiding inside the walls of a mental institution was supposed to distance her from the real world, but it seems Becks Gentry can’t leave her old life behind. A malicious killer drove her to give up everything she loved. Now he’s back and using her paintings as inspiration for his own showcase. Only this time, Becks isn’t going to run, and she’s not alone.<br><br>BAU agent Raider King has studied Becks for two years after learning of the killer’s attachment to her and her work. His research can prevent countless deaths once published, but as they uncover more of the artist’s masterpieces and the victims exsanguinated to create them, Raider discovers his own attachment to Becks. Putting everything they’ve worked for at risk.<br><br>Their worst nightmare is back to finish what he started. And nothing will ever be the same."; 
